def generatePlateSimDb():
    diverseSdf = "softfocus_diverse_uniq.sdf"
    plateDict = {}
    ifs = oemolistream()
    ifs.open(os.path.join(input_dir,diverseSdf))
    mol = OEGraphMol()
    while OEReadMolecule(ifs,mol):
        plate_id = OEGetSDData(mol,"plate_ID")
        if plate_id in plateSelectedAll:
            continue
        fp = OEFingerPrint()
        OEMakeFP(fp, mol, OEFPType_Circular)
        if not plateDict.has_key(plate_id):
            plateDict[plate_id] = []
        plateDict[plate_id].append(fp)
    ifs.close()
    plates = sorted(plateDict.keys())
    n_processors = 16
    trunk_size = len(plates)/n_processors
    trunks = list(chunks(plates,trunk_size))
    # import pprint
    # pprint.pprint(trunks)
    import multiprocessing
    manager = multiprocessing.Manager()
    result_dict = manager.dict()
    jobs = []
    for idx,trunk in enumerate(trunks):
         p = multiprocessing.Process(target=genPlateSimilarityMatrix, args=(idx,trunk,plates, result_dict, plateDict))
         jobs.append(p)
         p.start()
    for p in jobs:
        p.join()

    db = SqliteDict(os.path.join(input_dir,"PlateSim.db"))
    for plateId in result_dict.keys():
        db[plateId] = result_dict[plateId]
    db.commit()

